PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE mcu(
  PN text not null unique,
  Description text null,
  BuyDirect text not null,
  Status text not null,
  USD text null,
  Package text null,
  pins text null
);
CREATE TABLE s08(
  PN text not null unique,
  Description text null,
  BuyDirect text not null,
  Status text not null,
  Package text null,
  pins text null,
  USD text not null,
  Flash text null,
  RAM text null,
  cpu text null,
  MHz text null,
  Bus text null,
  PreDriver text null,
  CAN text null,
  UART text null,
  I2C text null,
  SPI text null,
  MinVdd float null,
  MaxVdd float null,
  GPIO text null,
  Temp text null,
  Timer text null,
  Features text null,
  HMI text null,
  SCI text null
);
CREATE TABLE power(
  "pn" TEXT,
  "Description" TEXT,
  "BuyDirect" TEXT,
  "Core" TEXT,
  "MHz" TEXT,
  "Flash" TEXT,
  "RAM" TEXT,
  "EEPROM" TEXT,
  "Security" TEXT,
  "GPIO" TEXT,
  "Ethernet" TEXT,
  "USB" TEXT,
  "LCD" TEXT,
  "CAN" TEXT,
  "UART" TEXT,
  "I2C" TEXT,
  "SPI" TEXT,
  "I2S" TEXT,
  "ADC_Channels" TEXT,
  "ADC_bits" TEXT,
  "Comparators" TEXT,
  "DAC_bits" TEXT,
  "Timers" TEXT,
  "Timer_bits" TEXT,
  "RTC" TEXT,
  "PWM" TEXT,
  "QEI" TEXT,
  "Package" TEXT,
  "Temp" TEXT,
  "TempSensor" TEXT,
  "IOH" TEXT,
  "MinVdd" TEXT,
  "MaxVdd" TEXT,
  "Status" TEXT
);
CREATE VIEW active as select * from mcu where status = 'Active';
CREATE VIEW inactive as select * from mcu where status <> 'Active';
COMMIT;
